	(6253,'http://www.villagevoice.com/events/laura-benanti-2534432/','Laura Benanti','laura-benanti','Another Broadway leading lady decides to frolic on a boite riser.  This lady, who\'s also an increasingly frequent television personality, just stole attention from some other acclaimed scene thieves in  Woman on the Verge of a Nervous Breakdown .  Since she also rounded up kudos in the last  Gypsy  revival, it\'s not surprising that she calls this turn \"Let Me Entertain You.\" Slim chance that she\'ll fail to live up to the title, although she will probably leave out Gypsy Rose Lee\'s pole-dancing maneuvers.',4,'2011-05-18 12:51:34','2011-05-18 12:51:34','http://www.villagevoice.com/events/laura-benanti-2534432/','http://vvoice.vo.llnwd.net/e14//6260002.47.jpg','',137,'event_images/17a0927432455380af354eaa689cb4be633d9fc4.jpg',1,6),
