	(6236,'http://www.villagevoice.com/events/occult-new-york-a-manhattan-walking-tour-2575276/','Occult New York, A Manhattan Walking Tour','occult-new-york-a-manhattan-walking-tour','New York City\'s history of the \"alternative\" is not limited to the musicians, poets, and artists plaque\'d and remembered all over downtown, but it is also lurking without reference in some of New York City\'s best-known landmarks. Discover this lost information on  Occult New York, A Manhattan Walking Tour  with Mitch Horowitz, (author of  Occult America: White House Séances, Ouija Circles, Masons, and the Secret Mystic History of Our Nation)  and open your eyes to the city\'s pivotal, yet often overlooked role in igniting the occult revival and revolutions in alternative spirituality from the 19th century to today. The walk includes a visit to the Fred F. French Building, the epitome of esoteric imagery designed by a New York City occult art aficionado who left his \"mysterious markings\" on buildings throughout the city; the Marble Collegiate Church, where Reverend Norman Vincent Peale spread mystical thinking centered around \"positive thinking\"; the Lamasery, a West Side tenement that was once a salon for the occult Theosophical Society (of which Thomas Edison was a member), and the New York New Church (a \"wellspring of supernatural ideas\" in the mid-19th century), whose Spiritualist leader is an ancestor of the Bush family. Black magic indeed!',4,'2011-05-18 12:51:32','2011-05-18 12:51:32','http://www.villagevoice.com/events/occult-new-york-a-manhattan-walking-tour-2575276/','http://vvoice.vo.llnwd.net/e14//6337136.47.jpg','',117,'event_images/b5066d01991c0fd45f2eff6dc23e34cfe2a0c644.jpg',1,0),
