	(6563,'http://www.villagevoice.com/events/chrissy-murderbot-machinedrum-2575353/','Chrissy Murderbot+Machinedrum','chrissy-murderbotmachinedrum','Oldtime British IDM label Planet Mu is all over Chicago\'s juke/footwork scene, signing DJ Nate and DJ Roc. Now it\'s released  Women\'s Studies , Chrissy Murderbot\'s unique tribute to the hyperactive, deceptively simple genre. A walking encyclopedia of rave and its offshoots, Murderbot shows off his knowledge in a constantly expanding treasure trove of mixes from Latin freestyle to early jungle to just about anything else you could name at his \"Year of Mix Tapes\" blog. Machinedrum put together MC Theophilus London\'s  This Charming Mixtape ; he\'s also half of NYC\'s own Sepalcure. With Contakt (Turrbotax).',4,'2011-05-18 12:52:13','2011-05-18 12:52:13','http://www.villagevoice.com/events/chrissy-murderbot-machinedrum-2575353/','http://vvoice.vo.llnwd.net/e14//6337617.47.jpg','',137,'event_images/2f1587a3d0c59470990b5b12cd03a873a180a75b.jpg',1,0),
	(6564,'http://www.villagevoice.com/events/countdown-to-election-12-only-538-days-left-2559187/','Countdown to Election \'12: Only 538 Days Left','countdown-to-election-12-only-538-days-left','Has your life been taken over by presidential election fever? Well, that fever won\'t be breaking any time soon. After all, it\'s still only 2011. We\'ve got a year and half of campaigning, punditry, and surprise \"targeted operations\" that nab long-wanted terrorists, before our country\'s future will be decided. Never one to come late to a party, satirist Andy Borowitz kicks off the party at  Countdown to Election \'12: Only 538 Days Left . Borowitz is joined by a top-notch panel, including comic Susie Essman ( Curb Your Enthusiasm ),  New Yorker  columnist Hendrik Hertzberg, and Calvin Trillin, for a very early assessment of the presidential playing field. The discussion will be followed by a mixer.',4,'2011-05-18 12:52:13','2011-05-18 12:52:13','http://www.villagevoice.com/events/countdown-to-election-12-only-538-days-left-2559187/','http://vvoice.vo.llnwd.net/e14//6304192.47.jpg','',140,'event_images/bafa96610ffadb54c6e8a2d0e02f641fc0b99318.jpg',1,0),
