	(6574,'http://www.villagevoice.com/events/brooklyn-boulders-1434611/','Brooklyn Boulders','brooklyn-boulders','Have you ever stared longingly at the Brooklyn Bridge and thought, I wish I could climb that?  Brooklyn Boulders , an 18,000-square-foot refuge for the urban climber located near the Gowanus, is happy to give you a shot. In addition to providing massive synthetic boulders, 360-degree climbing rooms, and 30-foot walls, Brooklyn Boulders even has a mock-up of the Brooklyn Bridge for patrons to exercise dreams of climbing local monuments. A Learn the Ropes class for beginners costs $75 and includes two day passes and rental gear. But perhaps most attractive to the skinny-jeans crowd (and youll see a lot of them here on the weekends) is the dance-club-volume stereo system that cranks out rock while you get in shape.',4,'2011-05-18 12:52:14','2011-05-18 12:52:14','http://www.villagevoice.com/events/brooklyn-boulders-1434611/','http://vvoice.vo.llnwd.net/e14//4004175.47.jpg','',4,'event_images/705418b9d5a578a335773940af991cf06d5267ab.jpg',1,0),
