	(6895,'http://www.villagevoice.com/events/blip-festival-2575247/','Blip Festival','blip-festival','As mainstream pop gets biggerheard that new Lady GagaClarence Clemons joint?the DIY fringe shrinks in response: This weekend\'s fifth-annual  Blip Festival  will present dozens of so-called chiptune acts (including Australia\'s punky Ten Thousand Free Men & Their Families, who perform tonight) devoted to making music from outmoded computer and video-game parts. (Beck threatened to take the style mainstream a few years ago, but it didn\'t take.) Three full nights of performances are scheduled, and on Saturday there\'s an afternoon workshop as well, at which you can learn how to program the Nintendo Entertainment System. Start digging through Mom\'s attic now.',4,'2011-05-18 12:52:56','2011-05-18 12:52:56','http://www.villagevoice.com/events/blip-festival-2575247/','http://vvoice.vo.llnwd.net/e14//6337047.47.jpg','',137,'event_images/093ee0cab23e0bede2a9d0b276f9a0afcdb8ba47.jpg',1,0),
