	(6914,'http://www.villagevoice.com/events/laurel-nakadate-2347919/','Laurel Nakadate','laurel-nakadate','They say crying is good for you; if thats true,  Laurel Nakadate  is doing just dandy. One photographic portion of  Only the Lonely  chronicles the artist before, during, and after weeping every day for a year. Being that this is Nakadates first large-scale museum exhibition, were guessing those are tears of joy. If photographs of private moments of sadness arent voyeuristic enough, check out what else is on view: videos from the past decade, in which the artist danced, posed, or played dead in the homes of anonymous men; and recent photos exploring the adolescent female body, for which Nakadate entered young womens bedrooms while they were sleeping, woke them, and told them to strip to their underwear.',4,'2011-05-18 12:52:59','2011-05-18 12:52:59','http://www.villagevoice.com/events/laurel-nakadate-2347919/','http://vvoice.vo.llnwd.net/e14//5893754.47.jpg','',127,'event_images/e124337652c9b0d58b8dab5c72ccecafd8851a42.jpg',1,0),
