	(6927,'http://www.villagevoice.com/events/lykke-li-2557815/','Lykke Li','lykke-li','The Swedish songstress goes gloomy on this year\'s  Wounded Rhymes , but the surprisingly aggressive result is far from a case of indie-twerp melancholia. Indeed, in tunes such as \"Unrequited Love\" and \"Sadness is a Blessing,\" Lykke Li\'s gutsy goth-soul vocals make you pity her less than you do the fool who broke her heart. The singer\'s current live show is a study in alluring opacity. With Grimes.',4,'2011-05-18 12:53:00','2011-05-18 12:53:00','http://www.villagevoice.com/events/lykke-li-2557815/','http://vvoice.vo.llnwd.net/e14//6310846.47.jpg','',137,'event_images/999070854424f4deb9d8742f25c8b746794439b6.jpg',1,373),
