	(6936,'http://www.villagevoice.com/events/hazmat-modine-2567219/','Hazmat Modine','hazmat-modine','A nine-member Masonic temple of a band featuring horns, harmonicas, and slinky guitars, Wade Schuman\'s Hazmat Modine operates in the secret creases and folds of American music. The wild ambitions of Hazmat\'s second album,  Cicada , almost disappear in the overarching familiarities of music that wends its way north from New Orleans to Chicago, while the sounds of Ethiopia, Sudan, and India pop up like secret corners at the local minimart.',4,'2011-05-18 12:53:01','2011-05-18 12:53:01','http://www.villagevoice.com/events/hazmat-modine-2567219/','http://vvoice.vo.llnwd.net/e14//6337765.47.jpg','',137,'event_images/5d4a6db5d3e0c742a736785188f0fbff2b5e5282.jpg',1,15),
