	(6938,'http://www.villagevoice.com/events/the-cameraman-2560736/','The Cameraman','the-cameraman','Dir. Buster Keaton (1928). Followed by a film short. Playing a newsreel cameraman, Buster Keaton reflects on his lost independence in this, the first film that he would make under contract to MGM. Its not first-rate Buster, but the New York locations and boffo closer give itnot to mention the notion of a monkey-made movie give it additional weight. HOBERMAN.',4,'2011-05-18 12:53:02','2011-05-18 12:53:02','http://www.villagevoice.com/events/the-cameraman-2560736/','','',173,'',1,1),
