	(7207,'http://www.villagevoice.com/events/king-lear-2522089/','King Lear','king-lear','April showers are ostensibly through, but dont tell that to Sir Derek Jacobi, who will call down cataracts, hurricanes, lightning, thunder, and assorted extreme weather onto the stage of Brooklyns BAM Harvey Theater for this production of  King Lear . Jacobi stars as the titular monarch of Shakespeares greatest tragedy in a production directed by Michael Grandage that originated at Londons Donmar Warehouse and which the  Daily Telegraph  critic called the finest and most searching Lear I have ever seen. Inspired by a myth of ancient Britain, the play concerns a king who decides to divide his estate among his three daughters, with tempestuous results. In an intimate space like the Harvey, the front rows just might be splash rows! O',4,'2011-05-18 12:53:36','2011-05-18 12:53:36','http://www.villagevoice.com/events/king-lear-2522089/','http://vvoice.vo.llnwd.net/e14//6252840.47.jpg','',125,'event_images/f2d0e257a48498a7e569129d8d6baccbb5274e0c.jpg',1,3),
