	(7237,'http://www.villagevoice.com/events/the-school-for-lies-2492450/','The School for Lies','the-school-for-lies','Is honesty always the best policy? What about when theres sex involved? In David Ivess new play  The School for Lies , the always-truthful Frank falls for a gossiping society woman. The key to winning her heart, of course, is through flattery and an artfully-spun rumor. Will he be able to woo her without hurting his integrity? The production, adapted from the Molière classic  The Misanthrope , stars Hamish Linklater and Mamie Gummer, daughter of Meryl Streep. Tony winner Walter Bobbie (Chicago), who staged Ivess Venus in Fur last season, directs.',4,'2011-05-18 12:53:39','2011-05-18 12:53:39','http://www.villagevoice.com/events/the-school-for-lies-2492450/','http://vvoice.vo.llnwd.net/e14//6176670.47.jpg','',125,'event_images/400c479fde116b919b6af889d20f52a61b9fbfc5.jpg',1,0),
	(7236,'http://www.villagevoice.com/events/jonny-greenwood-2575253/','Jonny Greenwood','jonny-greenwood','Radiohead fanatics not busying themselves with YouTube clips of Thom Yorke\'s recent appearance at L.A.\'s Low End Theory will undoubtedly flock this weekend to the American premiere of  Jonny Greenwood \'s  Doghouse , a typically foreboding orchestral piece commissioned last year by the BBC. It\'s one part of the latest concert in the classical-outreach Wordless Music series. Tonight and Saturday, Doghouse will be paired with György Ligeti\'s  Chamber Concerto  and  Heroes , Philip Glass\'s symphonic meditation on the work of his pals David Bowie and Brian Eno. Scowlers and chin-strokers, this you cannot afford to miss.',4,'2011-05-18 12:53:39','2011-05-18 12:53:39','http://www.villagevoice.com/events/jonny-greenwood-2575253/','http://vvoice.vo.llnwd.net/e14//6337048.47.jpg','',137,'event_images/226147043049c4188ba47a4818f19a549823d766.jpg',1,0),
	(7235,'http://www.villagevoice.com/events/murdered-by-the-mob-395893/','Murdered by the Mob','murdered-by-the-mob','Mingle with mobsters at this long-running murder-mystery show. A pasta dinner and dancing are included; solve the case and win a prize.',4,'2011-05-18 12:53:39','2011-05-18 12:53:39','http://www.villagevoice.com/events/murdered-by-the-mob-395893/','','',125,'',1,0),
	(7234,'http://www.villagevoice.com/events/signal-and-the-wordless-music-orchestra-presents-jonny-greenwood-gyorgy-ligeti-2573190/','\'Signal & the Wordless Music Orchestra Presents Jonny Greenwood+Gyorgy Ligeti\'','signal-the-wordless-music-orchestra-presents-jonny','Attention, Radiohead fans: we know that you\'re desperate for them to tour after their last album, but their artiest member won\'t bow his guitar for you tonight. As Greenwood proved with his wonderfully creepy score to  There Will Be Blood , he\'s a real composer. This show serves as the U.S. premiere of his high-drama, tear-jerking work \"Doghouse,\" appropriately along with Ligeti\'s austere \"Chamber Concerto\" and Glass/Bowie/Eno\'s \"Symphony No. 4\" (based on \"Heroes\"). If Lincoln Center makes you squeamish, get your high-art on here. With Gyorgy Ligeti.',4,'2011-05-18 12:53:39','2011-05-18 12:53:39','http://www.villagevoice.com/events/signal-and-the-wordless-music-orchestra-presents-jonny-greenwood-gyorgy-ligeti-2573190/','http://vvoice.vo.llnwd.net/e14//6337577.47.jpg','',137,'event_images/0ff5faca0a42348a6788679b97c3cddf878d6dd4.jpg',1,0),
