	(7213,'http://www.villagevoice.com/events/the-intelligent-homosexuals-guide-to-capitalism-and-socialism-with-a-key-to-the-scriptures-2433172/','The Intelligent Homosexual\'s Guide to Capitalism and Socialism with a Key to the Scriptures','the-intelligent-homosexuals-guide-to-capitalism-an','What\'s in a name?  The Intelligent Homosexual\'s Guide to Capitalism and Socialism With a Key to the Scriptures a prolix heading borrowed from George Bernard Shaw and Mary Baker Eddyshould in no way diminish the excitement generated by Tony Kushner\'s new play. A co-production of the Public Theater and the Signature Theater, directed by Michael Greif, the play unfurls in a Brooklyn Brownstone in 2007. Gus (Michael Cristofer), a retired dockworker and working Marxist, summons his adult children home and announces his plan to commit suicide. Though the piece\'s Minnesota debut was marred by a delayed opening night and frantic rewrites, most critics concluded that Kushner had crafted a deeply felt and deeply political drama, which cast members, such as Linda Emond and Stephen Spinella, should help unlock.',4,'2011-05-18 12:53:36','2011-05-18 12:53:36','http://www.villagevoice.com/events/the-intelligent-homosexuals-guide-to-capitalism-and-socialism-with-a-key-to-the-scriptures-2433172/','http://vvoice.vo.llnwd.net/e14//6081910.47.jpg','',125,'event_images/6cddf0dfb5365a69a06abfb963d6989cf0ab1854.jpg',1,0),
