	(7396,'http://www.villagevoice.com/events/alice-waters-2575280/','Alice Waters','alice-waters','Back in the early \'70s, \"organic\" food wasn\'t something you could easily find on restaurant menus. But thanks to  Alice Waters , author, chef, and food educator, who maintains that cooking should be based on the finest and freshest seasonal ingredients that are produced sustainably and locally, \"organic\" is something we now demand. Waters, chef and owner of Chez Panisse, a restaurant in Berkeley, California, known for using local, organic foods and voted one of the best restaurants in the country, speaks today as part of the New Museum\'s Visionaries Series, which honors leading international thinkers in disciplines of contemporary culture.',4,'2011-05-18 12:54:00','2011-05-18 12:54:00','http://www.villagevoice.com/events/alice-waters-2575280/','http://vvoice.vo.llnwd.net/e14//6337143.47.jpg','',34,'event_images/f8cfc366ea611f556e82b04ac93d5318c745a6e0.jpg',1,0),
