	(7327,'http://www.villagevoice.com/events/lynda-benglis-2363532/','Lynda Benglis','lynda-benglis','In 1974, American sculptor artist  Lynda Benglis  posed for  Artforum  wearing nothing but sunglasses and a giant latex dildo. This was her attempt to say, in so many words, that the art world isnt a mans world. Nearly four decades later, we are still taking notice of her brilliant work as the New Museum presents her first major retrospective in more than 20 years. The show includes her infamous poured latex pieces from the 60s and 70s, early bronze casts, wax reliefs, videos, Bengliss largest pour sculpture at almost 40 feet in length titled Contraband, which was first seen at the Whitney, and Phantom, a polyurethane installation consisting of five monumental sculptures that glow in the dark. Well be wearing shades, too.',4,'2011-05-18 12:53:51','2011-05-18 12:53:51','http://www.villagevoice.com/events/lynda-benglis-2363532/','http://vvoice.vo.llnwd.net/e14//5920031.47.jpg','',127,'event_images/49a90368d60ce6d6b3bf1e9454c8fbe8e93af207.jpg',1,0),
