	(7457,'http://www.villagevoice.com/events/this-world-and-nearer-ones-1220251/','This World and Nearer Ones','this-world-and-nearer-ones','Looking for the perfect island getaway? We know one that won\'t cost you a penny. Take the ferry to Governors Island for the opening weekend of  This World and Nearer Ones , 19 site-specific artworks by top international, contemporary artists who were asked to respond to their sites on the island. Spend the day wandering from screenings to sculptures to performances on themes ranging from the history of the island to \"bizarre phenomena.\" Artists include Patti Smith and her daughter, Jesse, who put together an audio piece to be listened to on portable audio players; the Bruce High Quality Foundation, which produced an original film about a zombie invasion that culminates on Governors Island; and storyteller-performer Tris Vonna-Michell, who will give performances on the history and culture of Governors Island. The exhibition is the first edition of Creative Time\'s new public art quadrennial PLOT.',4,'2011-05-18 12:54:09','2011-05-18 12:54:09','http://www.villagevoice.com/events/this-world-and-nearer-ones-1220251/','http://vvoice.vo.llnwd.net/e14//3538430.47.jpg','',197,'event_images/1fc67353bc65942a85b5cda54327a98faaa3a66d.jpg',1,1),
