	(7455,'http://www.villagevoice.com/events/real-estate-2561845/','Real Estate','real-estate','As Slumberland continues to prove itself the ultimate home for dreamy indie pop, these Jersey boys (who are now Brooklynites) are proving to be one of the brightest jewels in their catalog, behind Pains of Being Pure at Heart but on par with Brilliant Colours. As sweet and swoon-worthy as their 2009 self-titled debut proved, the question is if they have it in them to follow it up with their still-untitled sophomore effort, due out this year. As delicate as they are in the studio, they can still put out live, which gives us some hope for that next record. With Julian Lynch, Big Troubles, and Family Portrait.',4,'2011-05-18 12:54:09','2011-05-18 12:54:09','http://www.villagevoice.com/events/real-estate-2561845/','http://vvoice.vo.llnwd.net/e14//6330985.47.jpg','',137,'event_images/a6f2d977ea99a1c2a6bbf33637b3b2e028ed801f.jpg',1,6),
