	(6697,'http://www.villagevoice.com/events/tune-yards-2575265/','tUnE-YaRds','tune-yards','Fine, we hereby submit to the maddening spelling of  tUnE-YaRds  and the aggressive spacing of second album  w h o k i l l , but only because she is so bad-ass. (Everybody gets one.) In fact, New England\'s Merrill Garbus is truly an esoteric singer-songwriter breed unto herself with songs that halt, jump, and skitter in wonderful dischord.  w h o k i l l  delivers a communal sophistication unlike its predecessor, BiRd-BrAiNs, but both records are truly, simply conduits of her id. And that is a great compliment, for what instincts she has.',4,'2011-05-18 12:52:30','2011-05-18 12:52:30','http://www.villagevoice.com/events/tune-yards-2575265/','http://vvoice.vo.llnwd.net/e14//6337088.47.jpg','',137,'event_images/aa0b05e96882810ea964b9949eb50767c1d6d723.jpg',1,15),
