	(7518,'http://www.villagevoice.com/events/objectify-1065692/','OBJECTify','objectify','\"A monthly party for intelligent technophiles and discerning fetishists,\" OBJECTify allows guests to take on the Dadaist anti-aesthetic. Each month the party will obsess over one object. The partys objective is to unite many different types of people through experiencing and exploring. This months object: the eggbeater.',4,'2011-05-18 12:54:17','2011-05-18 12:54:17','http://www.villagevoice.com/events/objectify-1065692/','','',142,'',1,4),
